paths:
  /distributions:
    get:
      tags:
        - distributions
      summary: Retrieve the list of available distributions from Alliance Cloud.
      description: This operation enables retrieving the list of available distributions for download from Alliance Cloud. The DN used to perform the OAuth process with SWIFT API Gateway is the one used to link the request to an application channel in Alliance Cloud.
      operationId: listDistributions
      parameters:
      - name: limit
        in: query
        description: Number of distributions to be returned. If the provided value is out of range or is not a parsable integer, the default value will be used for the request
        required: false
        style: form
        explode: true
        schema:
          type: integer
          default: 50
          minimum: 1
          maximum: 200
      - name: offset
        in: query
        description: Number of distributions to skip before returning results. If the provided value is out of range or is not a parsable integer, the default value will be used for the request
        required: false
        style: form
        explode: true
        schema:
          type: integer
          default: 0
          minimum: 0
      responses:
        "200":
          description: OK
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/ListDistributionsResponse'
              examples:
                List Distribution Statuses for all services:
                  $ref: '#/components/examples/ListAllDistributionsResponse'
        "400":
          $ref: '#/components/responses/InvalidRequest'
        "403":
          $ref: '#/components/responses/Forbidden'
        default:
          $ref: '#/components/responses/UnexpectedError'
    patch:
      tags:
        - distributions
      summary: Update the status of multiple distributions in Alliance Cloud.
      description: This operation enables updating the status of several distributions in a single API call. Updates to the status for each distribution can either be 'Ack' or 'Nak'. In case of a 'Nak', an optional message describing the reason for the NAK can be specified. If specified in an 'Ack' status update, the message will be ignored
      operationId: updateDistributions
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/DistributionsUpdate'
            examples:
              Distributions Update Example:
                $ref: '#/components/examples/DistributionsUpdateRequest'
        required: true
      responses:
        "200":
          description: The request has been processed successfully. Each individual distribution update result is present in the response body
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/DistributionsUpdateResponse'
              examples:
                NAK Example:
                  $ref: '#/components/examples/DistributionsUpdateResponse'
        "400":
          $ref: '#/components/responses/InvalidRequest'
        "403":
          $ref: '#/components/responses/Forbidden'
        default:
          $ref: '#/components/responses/UnexpectedError'
      
