      summary: Retrieve a single available distribution from Alliance Cloud.
      description: This operations enables retrieving a single available distribution from Alliance Cloud, providing its id. The DN used to perform the OAuth process with SWIFT API Gateway is the one used to link the request to an application channel in Alliance Cloud.
      operationId: getDistribution
