      summary: Send a batch of FIN messages to Alliance Cloud.
      description: |- 
        This operation enables sending multiple FIN messages to Alliance Cloud, in a single API call. For a given batch request, every single message must have its sender_reference field present and not empty.
        All sender_reference values from the message items must be unique inside a given batch request. A maximum of 500 FIN messages can be sent in one call.
      operationId: sendBatchFinMessages
      parameters:
      - $ref: '#/components/parameters/X-SWIFT-Signature'
      requestBody:
        content:
          application/json:
            schema:
              $ref: '#/components/schemas/FinMessagesBatchEmission'
            examples:
              FIN 101 messages upload:
                $ref: '#/components/examples/FinMessageBatchUploadRequest'
              FIN mix messages upload:
                $ref: '#/components/examples/FinMessageBatchUploadRequestAlternate'
        required: true
      responses:
        "202":
          description: Accepted
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/SendBatchMessagesResponse'
              examples:
                FIN Batch Messages upload response:
                  $ref: '#/components/examples/FinMessagesUploadBatchResponse'  
        "400":
          $ref: '#/components/responses/InvalidRequest'
        "403":
          $ref: '#/components/responses/Forbidden'
        default:
          $ref: '#/components/responses/UnexpectedError'          

