          $ref: '#/components/responses/InvalidRequest'
        "403":
          $ref: '#/components/responses/Forbidden'
        "404":
          $ref: '#/components/responses/NotFound'
        default:
          $ref: '#/components/responses/UnexpectedError'
          
  /fileact/exports:
    get:
      tags:
      - fileact
      summary: Download one or several FileAct message exports ready to be distributed.
      description: Retrieve FileAct exports using one or several distribution ID's
      operationId: downloadFileActExports
      parameters:
      - name: distribution-id
        in: query
        description: The ID's of the distributions to download. The value of this query parameter is a comma-separated list of distribution ID's (e.g. distribution-id=44984189499,44984189498,44984189497)
        required: true
        style: form
        explode: false
        schema:
          type: array
          minimum: 1
          maximum: 100
          items:
            type: integer
            format: int64
      responses:
        "200":
          description: OK
          headers:
            X-SWIFT-Integrity:
              $ref: '#/components/headers/X-SWIFT-Integrity'
          content:
            application/json:
              schema:
                type: array
                items:
                  $ref: '#/components/schemas/FileActExportDownloadResponse'
              examples:
                Retrieved FileAct exports:
                  $ref: '#/components/examples/FileActExportDownloadBatchResponse'
        "400":
          $ref: '#/components/responses/InvalidRequest'
        "403":
          $ref: '#/components/responses/Forbidden'
        default:
          $ref: '#/components/responses/UnexpectedError'

  /fileact/exports/{distribution-id}:
    get:
      tags:
      - fileact
      summary: Download an FileAct export ready to be distributed.
      description: Retrieve a FileAct export using its distribution ID
      operationId: downloadFileActExport
      parameters:
      - name: distribution-id
        in: path
        description: The id of the distribution
        required: true
        style: simple
        explode: false
        schema:
          type: integer
          format: int64
      responses:
        "200":
          description: OK
          headers:
            X-SWIFT-Integrity:
              $ref: '#/components/headers/X-SWIFT-Integrity'
          content:
            application/json:
              schema:
                $ref: '#/components/schemas/FileActExportDownloadResponse'
              examples:
                Retrieved FileAct export:
                  $ref: '#/components/examples/FileActExportDownloadResponse'
            application/pdf:
              schema:
                description: "The PDF export in binary, without additional distribution information"
                type: string
                format: binary
        "400":
          $ref: '#/components/responses/InvalidRequest'
        "403":
          $ref: '#/components/responses/Forbidden'
        "404":
          $ref: '#/components/responses/NotFound'
        default:
          $ref: '#/components/responses/UnexpectedError'
          
          
components:
  schemas:
    ErrorMessage:
      title: Error Message
      description: Structure holding all error messages coming back from Alliance Cloud
      required:
      - code
      - severity
      - text
      type: object
      additionalProperties: true
      properties:
        code:
          description: Identifier of the error
          type: string
        severity:
          description: Severity of the error. Example values are "Fatal", "Transient"
          type: string
        text:
          description: Textual description of the error
          type: string
        user_message:
          description: If applicable, additional message for the application user
          type: string
        more_info:
          description: If applicable, contains a link for more information about the error
          type: string
      example: |-
        {
          "code": "AC-500",
          "severity": "fatal",
          "text": "An error occured.",
          "user_message": "Message to be passed to the app user, if applicable.",
          "more_info": "https://developer.swift.com/AC-500"
        }
    ListDistributionsResponse:
      title: ListDistributionsResponse
      description: Information about distributions available for download from Alliance Cloud
      type: object
      additionalProperties: true
      properties:
        distributions:
          description: Array of distributions that are available for download
          type: array
          items:
            $ref: '#/components/schemas/Distribution'
        links:
          $ref: '#/components/schemas/Links'
    Distribution:
      title: Distribution
      description: An Alliance Cloud distribution
      type: object
      additionalProperties: true
      properties:
        id:
          description: The unique distribution identifier
          type: integer
          format: int64
        service:
          description: The service / protocol for the distribution
          type: string
          enum:
          - fin
          - interAct
          - fileAct
        type:
          description: The distribution type
          type: string
          enum:
          - message
          - deliveryReport
          - deliveryNotification
          - transmissionReport
          - archive
          - export
        distribution_tag:
          description: The tag associated to the distribution
          type: string
          maxLength: 256
        transmission_possible_duplicate:
          description: Whether the distribution has already been tentatively downloaded at least once
          type: boolean
          default: false
        copy:
          description: Whether the distribution is about a copy or an original message 
          type: boolean
        message_cloud_reference:
          description: The unique identifier of the message linked to the distribution. For deliveryReport and transmissionReport types, it will be the one of the sent message
          type: string
          format: uuid
        export_content:
          description: Identifies the contents of the export. Currently only 'message' exports are supported by Alliance Cloud
          type: string
          maxLength: 50
        export_format:
          description: Identifies the format of the export. Currently only 'pdf' format is supported by Alliance Cloud
          type: string
          maxLength: 50
        links:
          $ref: '#/components/schemas/Links'
    FinMessageDownloadResponse:
      title: FinMessageDownloadResponse
      type: object
      additionalProperties: true
      properties:
        distribution:
          $ref: '#/components/schemas/Distribution'
        message:
          $ref: '#/components/schemas/FinMessageReception'
      description: The response for a FIN message distribution download. It contains the distribution information along with the message contents
    FinTransmissionReportDownloadResponse:
      title: FinTransmissionReportDownloadResponse
      type: object
      additionalProperties: true
      properties:
        distribution:
          $ref: '#/components/schemas/Distribution'
        transmission_report:
          $ref: '#/components/schemas/FinTransmissionReportReception'
      description: The response for a FIN transmission report distribution download. It contains the distribution information along with the transmission report contents
    FinDeliveryNotificationDownloadResponse:
      title: FinDeliveryNotificationDownloadResponse
      type: object
      additionalProperties: true
      properties:
        distribution:
          $ref: '#/components/schemas/Distribution'
        delivery_notification:
          $ref: '#/components/schemas/FinDeliveryNotificationReception'
      description: The response for a FIN delivery notification distribution download. It contains the distribution information along with the delivery notification contents
    FinDeliveryReportDownloadResponse:
      title: FinDeliveryReportDownloadResponse
      type: object
      additionalProperties: true
      properties:
        distribution:
          $ref: '#/components/schemas/Distribution'
        delivery_report:
          $ref: '#/components/schemas/FinDeliveryReportReception'
      description: The response for a FIN delivery report distribution download. It contains the distribution information along with the delivery report contents
    FinArchiveDownloadResponse:
      title: FinArchiveDownloadResponse
      type: object
      properties:
        distribution:
          $ref: '#/components/schemas/Distribution'
        archive:
          $ref: '#/components/schemas/FinArchiveReception'
      additionalProperties: true
      description: The response for a FIN archive distribution download. It contains the distribution information along with the archive contents
    FinExportDownloadResponse:
      title: FinExportDownloadResponse
      type: object
      properties:
        distribution:
          $ref: '#/components/schemas/Distribution'
        export:
          type: string
          format: byte
          description: The export contents
      additionalProperties: true
      description: The response for a FIN export distribution download in JSON. It contains the distribution information along with the export contents
    FinMessageReception:
      title: FinMessageReception
      required:
      - direction
      - message_type
      - payload
      - receiver
      - sender
      - sender_reference
      - version
      type: object
      additionalProperties: true
      properties:
        sender_reference:
          description: |-
           For emission and STP: represents the reference from the back office.
           For reception or GUI: contains the Message Cloud Reference.
          maxLength: 70
          type: string
        message_type:
          description: |-
           The type of the message. For an MT message, the format is fin|apc.<msgtype>[.<variant>]. For example: fin.103, fin.103.REMIT or fin.202, fin.202.COV
          maxLength: 30
          type: string
        sender:
          description: |-
           It corresponds to the BIC12 of the sender. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For received messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        receiver:
          description: |-
           It corresponds to the BIC12 of the receiver. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For sent messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        version:
          description: |-
            Identifies the version for this received message. Messages that are modified in Alliance Cloud have their version incremented. The initial version of a message is 0
          type: integer
        interface_info:
          $ref: '#/components/schemas/FinMessageInterfaceInfoReception'          
        network_info:
          $ref: '#/components/schemas/FinMessageNetworkInfoReception'
        security_info:
          $ref: '#/components/schemas/FinMessageSecurityInfoReception'
        payload:
          description: |-
           The business message contents. As this is a FIN message, this contains the MT block 4 (text) data.
          type: string
          format: byte
          maxLength: 14000
        direction:
          description: |-
           Direction of the message. Possible values are:
            - Incoming: message received from the network
            - Outgoing: message sent to the network
          type: string
          enum:
          - Outgoing
          - Incoming
      description: FIN message contents received from Alliance Cloud. Depending on the 'direction', the available fields will vary. 'Outgoing' direction is for a message sent from a back-office to SWIFT, via Alliance Cloud. 'Incoming' is for a message received from SWIFT, via Alliance Cloud.
    FinTransmissionReportReception:
      title: FinTransmissionReportReception
      required:
      - sender_reference
      - delivery_status
      - receiver
      - response_date
      type: object
      additionalProperties: true
      properties:
        sender_reference:
          description: |-
           For emission and STP: represents the reference from the back office.
           For reception or GUI: contains the Message Cloud Reference.
          maxLength: 70
          type: string
        message_input_reference:
          description: |-
           A unique reference number assigned by the SWIFT central system to every FIN outgoing message.
           This number consists of the message input date, the FIN address of the sender, the input session number, and the input sequence number.
          maxLength: 28
          type: string
        message_input_time:
          description: |-
           Local time and date the outgoing message was received by the SWIFT central system. Format is yyyyMMddHHmmss (e.g. 20230725105547)
          type: string
          maxLength: 14
        response_date:
          description: |-
           The intervention creation date and time.
          type: string
          format: date-time
        delivery_status:
          description: |-
           The network delivery status. 'Rejected' is for messages that have been rejected by Alliance Cloud before sending it to the network.
          type: string
          nullable: true
          enum:
          - Acked
          - Nacked
          - Rejected
        rejection_code:
          description: |-
           The Nack code of the rejection.
          maxLength: 12
          type: string
        rejection_reason:
          description: |-
           The Nack reason of the rejection.
          maxLength: 1800
          type: string
        message_user_reference:
          description: |-
           The Message User Reference set by the BO for messages received by the BO or by the user for messages manually created or by the sender for received messages.
           For FIN, this corresponds to the MUR (field 108 of block 3).
          maxLength: 16
          type: string
        receiver:
          description: |-
           It corresponds to the BIC12 of the receiver. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For sent messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        network_info:
          $ref: '#/components/schemas/FinTransmissionReportNetworkInfoReception'
        message:
          $ref: '#/components/schemas/FinMessageReception'
      description: FIN transmission report contents received from Alliance Cloud
    FinDeliveryNotificationReception:
      title: FinDeliveryNotificationReception
      required:
      - delivery_status
      - message_input_reference
      - message_type
      - receiver
      - response_date
      type: object
      additionalProperties: true
      properties:
        message_input_reference:
          description: |-
           A unique reference number assigned by the SWIFT central system to every FIN outgoing message.
           This number consists of the message input date, the FIN address of the sender, the input session number, and the input sequence number.
          maxLength: 28
          type: string
        delivery_status:
          description: |-
           The Delivery Notification status.
          nullable: true
          type: string
          enum:
          - Delivered
          - Aborted
          - DelayedNak
          - FincopyReleased
          - Overdue
        response_date:
          description: |-
           The intervention creation date and time.
          type: string
          format: date-time
        message_type:
          description: |-
           The type of the message. For an MT message, the format is fin|apc.<msgtype>[.<variant>]. For example: fin.103, fin.103.REMIT or fin.202, fin.202.COV
          maxLength: 30
          type: string
        receiver:
          description: |-
           It corresponds to the BIC12 of the receiver. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For sent messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        network_info:
          $ref: '#/components/schemas/FinDeliveryNotificationNetworkInfoReception'
        security_info:
          $ref: '#/components/schemas/FinDeliveryNotificationSecurityInfoReception'
        payload:
          description: |-
           The content of the delivery notification system message.
          type: string
          format: byte
          maxLength: 14000
      description: FIN delivery notification contents received from Alliance Cloud
    FinDeliveryReportReception:
      title: FinDeliveryReportReception
      required:
      - delivery_notification_payload
      - delivery_status
      - message_input_reference
      - receiver
      - response_date
      - sender_reference
      type: object
      additionalProperties: true
      properties:
        sender_reference:
          description: |-
           For emission and STP: represents the reference from the back office.
           For reception or GUI: contains the Message Cloud Reference.
          maxLength: 70
          type: string
        message_input_reference:
          description: |-
           A unique reference number assigned by the SWIFT central system to every FIN outgoing message.
           This number consists of the message input date, the FIN address of the sender, the input session number, and the input sequence number.
          maxLength: 28
          type: string
        response_date:
          description: |-
           The intervention creation date and time.
          type: string
          format: date-time
        delivery_status:
          description: |-
           The Delivery Notification status.
          type: string
          nullable: true
          enum:
          - Delivered
          - Aborted
          - DelayedNak
          - FincopyReleased
          - Overdue
        receiver:
          description: |-
           It corresponds to the BIC12 of the receiver. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For sent messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        delivery_notification_payload:
          description: |-
           The content of the delivery notification system message.
          type: string
          format: byte
          maxLength: 14000
        network_info:
          $ref: '#/components/schemas/FinDeliveryReportNetworkInfoReception'
        message:
          $ref: '#/components/schemas/FinMessageReception'
      description: FIN delivery report contents received from Alliance Cloud
    FinMessageNetworkInfoReception:
      title: FinMessageNetworkInfoReception
      type: object
      additionalProperties: true
      properties:
        network_priority:
          description: |-
           The Network priority. Possible values are:
           - Normal
           - Urgent
           - System
           Default value: Normal
          type: string
          default: Normal
          nullable: true
          enum:
          - Normal
          - Urgent
          - System
        possible_duplicate:
          description: |-
           For messages originated from the BO: if set to true, the BO indicated that the message is a PDE (Possible Duplicate Emission).
           For messages sent to the BO: if set to true, Alliance Cloud indicates that the message is a PDE. The reason can either be duplicate detected by Cloud or set by the sender, or by the Network, or by the BO in case it is related to the copy of a message.
          type: boolean
        duplicate_history:
          $ref: '#/components/schemas/DuplicateHistory'
        delivery_monitoring:
          description: |-
           Indicates whether a non-delivery warning and/or a positive delivery notification is requested.
          type: string
          nullable: true
          enum:
          - None
          - NonDelivery
          - NonDeliveryAndDelivery
          - Delivery
        sequence_number:
          description: |-
           The network sequence number
          type: integer
        session_number:
          description: |-
           The network session number
          type: integer
        message_input_time:
          description: |-
           Local time and date the outgoing message was received by the SWIFT central system. Format is yyyyMMddHHmmss (e.g. 20230725105547)
          type: string
          maxLength: 14
        message_input_reference:
          description: |-
           A unique reference number assigned by the SWIFT central system to every FIN outgoing message.
           This number consists of the message input date, the FIN address of the sender, the input session number, and the input sequence number.
          maxLength: 28
          type: string
        local_output_time:
          description: |-
           Time and date the incoming message was received by Alliance Cloud. Format is yyyyMMddHHmmss (e.g. 20230725105547)
          type: string
          maxLength: 14
        fincopy_service:
          description: |-
           Service code of the fin copy service.
          maxLength: 3
          type: string
        fincopy_central_institution_destination:
          description: |-
           BIC8 of the central institution used for FIN Copy.
          maxLength: 8
          type: string
        fincopy_release_info:
          description: |-
           FIN User Header field 115: information details from the Central Institution to the receiver of the message. Only applicable for incoming messages.
          maxLength: 32
          type: string
        message_reference:
          description: |-
           The Message User Reference set by the BO for messages received by the BO or by the user for messages manually created or by the sender for received messages.
           For FIN, this corresponds to the MUR (field 108 of block 3).
          maxLength: 50
          type: string
        banking_priority:
          description: |-
           FIN User Header field 113: Banking Priority set by the creator of the message.
          maxLength: 4
          type: string
        message_user_reference:
          description: |-
           The Message User Reference set by the BO for messages received by the BO or by the user for messages manually created or by the sender for received messages.
           For FIN, this corresponds to the MUR (field 108 of block 3).
          maxLength: 16
          type: string
        validation_identifier:
          description: |-
           FIN User Header field 119: Contains the Validation Identifier and indicates whether FIN central system must perform a special validation.
          maxLength: 8
          type: string
        mirs_balance_checkpoint_date_time:
          description: |-
           Contains field 423 from FIN User Header (block 3). This field is not displayed in the UI as MIRS is not supported by Alliance Cloud.
          type: string
          maxLength: 14
        mirs_message_input_reference:
          description: |-
           Contains field 106 from FIN User Header (block 3). This field is not displayed in the UI as MIRS is not supported by Alliance Cloud.
          maxLength: 30
          type: string
        mirs_related_reference:
          description: |-
           Contains field 424 from FIN User Header (block 3). This field is not displayed in the UI as MIRS is not supported by Alliance Cloud.
          maxLength: 16
          type: string
        service_type_identifier:
          description: |-
           A numeric code contained in field 111 of a FIN gpi message that identifies the gpi service against which the gpi customer will be measured.
           For example, the service type identifier for the gpi customer credit transfer service is 001.
          maxLength: 3
          type: string
        uetr:
          description: |-
           A unique end-to-end transaction reference. This reference contains a Universally Unique IDentifier (UUID) compliant with version 4 of standard RFC4122.
           It is transported in field 121 of gpi messages.
          type: string
          format: uuid
        fininform_release_info:
          description: |-
           This field contains information from the server destination to the receiver of the message. It is only available for incoming messages in the context of FINInform services that operate in Y-copy mode.
          maxLength: 39
          type: string
        screening_info_for_receiver:
          description: |-
           The Authorisation/Refusal Notification details from the screening service. This field is only for incoming messages screened with SSS or TSS in FIN copy mode.
           The following values can be present in this field:
            - AOK: message automatically released by screening service
            - FPO: compliance officer has flagged the screening result as false positive
            - NOK: compliance officer has flagged the screened message as suspect or the message wasauto released by the service
           The code word can optionally be followed by additional information (up to 20 characters from the x character set).
          maxLength: 25
          type: string
        payment_controls_info_for_receiver:
          description: |-
           Payment controls information for receiver. This field provides information to the receiver from the Payment Controls service.
           It contains FIN User Header field 434.
          maxLength: 25
          type: string
        system_originated:
          description: |-
           Content of the SYS trailer. The system message or service message that a system pseudo logical terminal generates has a System-Originated Message trailer (SYS).
           All solicited system messages (service identifier 01) contain the message input reference of the user request, and may also contain the time.
          maxLength: 38
          type: string
        delayed_message:
          description: |-
           Messages with a a Delayed Message trailer are messages that have exceeded the obsolescence period.
          type: boolean
        syntax_version:
          description: |-
           The FIN syntax version.
          type: string
          maxLength: 7
        in_flow_translation:
          $ref: '#/components/schemas/InFlowTranslation'
      description: The network information elements for a FIN message received from Alliance Cloud.
    InFlowTranslation:
      title: InFlowTranslation
      type: object
      additionalProperties: true
      properties:
        version:
          description: |-
           The version of the applied translation.
          maxLength: 16
          type: string
        result:
          description: |-
           The result of the applied translation, as sent by SWIFT Network.
          maxLength: 19
          type: string
        errors:
          description: |-
           The errors or warnings that happened during the translation process.
          type: array
          items:
            $ref: '#/components/schemas/InFlowTranslationError'
      description: If applicable, the result and details of the in-flow translation performed centrally, from a MX message to a MT message.
    InFlowTranslationError:
      title: InFlowTranslationError
      type: object
      additionalProperties: true
      properties:
        code:
          description: |-
           The code for this translation error or warning item.
          maxLength: 19
          type: string
        message:
          description: |-
           Message that describes this translation error or warning.
          maxLength: 16000
          type: string
        path:
          description: |-
           The path for which this translation error or warning applies.
          maxLength: 256
          type: string
      description: An error or warning that happened during the in-flow translation process.
    FinTransmissionReportNetworkInfoReception:
      title: FinNetworkInfoTransmissionReportReception
      type: object
      additionalProperties: true
      properties:
        message_network_priority:
          description: |-
           The Network priority of the sent message.
          type: string
          default: Normal
          nullable: true
          enum:
          - Normal
          - Urgent
          - System
        message_possible_duplicate:
          description: |-
           The sent message 'possible_duplicate' value
          type: boolean
          default: false
        session_number:
          description: |-
           The network session number of the received transmission report.
          type: integer
        sequence_number:
          description: |-
           The network sequence number of the received the transmission report.
          type: integer
      description: The network information elements for a FIN transmission report received from Alliance Cloud.
    FinDeliveryNotificationNetworkInfoReception:
      title: FinNetworkInfoDeliveryNotificationReception
      type: object
      additionalProperties: true
      properties:
        network_priority:
          description: |-
           The Network priority of the delivery notification message.
          type: string
          default: Normal
          nullable: true
          enum:
          - Normal
          - System
          - Urgent
        possible_duplicate:
          description: |-
           For messages originated from the BO: if set to true, the BO indicated that the message is a PDE (Possible Duplicate Emission).
           For messages sent to the BO: if set to true, Alliance Cloud indicates that the message is a PDE. The reason can either be duplicate detected by Cloud or set by the sender, or by the Network, or by the BO in case it is related to the copy of a message.
          type: boolean
          default: false
        duplicate_history:
          $ref: '#/components/schemas/DuplicateHistory'
        session_number:
          description: |-
           The network session number.
          type: integer
        sequence_number:
          description: |-
           The network sequence number.
          type: integer
        message_input_time:
          description: |-
           Local time and date the outgoing message was received by the SWIFT central system. Format is yyyyMMddHHmmss (e.g. 20230725105547)
          type: string
          maxLength: 14
      description: The network information elements for a FIN delivery notification received from Alliance Cloud.
    FinDeliveryNotificationSecurityInfoReception:
      title: FinDeliveryNotificationSecurityInfoReception
      required:
      - checksum_result
      type: object
      additionalProperties: true
      properties:
        checksum_result:
          description: |-
           The result of the FIN checksum validation. Possible values are:
           - Success
           - Failed
          type: string
          nullable: true
          enum:
          - Success
          - Failed
        checksum_value:
          description: |-
           The value of the FIN checksum.
          maxLength: 12
          type: string
      description: The security information elements for a FIN delivery notification received from Alliance Cloud.
    FinDeliveryReportNetworkInfoReception:
      title: FinNetworkInfoDeliveryReportReception
      required:
      - message_sequence_number
      - message_session_number
      type: object
      additionalProperties: true
      properties:
        message_sequence_number:
          description: |-
           The network sequence number of the sent message linked to this delivery report.
          type: integer
        message_session_number:
          description: |-
           The network session number of the sent message linked to this delivery report.
          type: integer
        message_possible_duplicate:
          description: |-
           The 'possible_duplicate' value of the sent message linked to this delivery report.
          type: boolean
          default: false
        message_network_priority:
          description: |-
           The 'network_priority' value of the sent message linked to this delivery report.
