      - payload
      - receiver
      - sender
      - sender_reference
      type: object
      additionalProperties: false
      properties:
        sender_reference:
          description: |-
           The reference provided by the back office application for further reconciliation.
           For reconciliation to behave as expected, this reference is expected to be unique for a given user/institution (User Unique Message Identifier - UUMID)
          maxLength: 70
          type: string
        message_type:
          description: |-
           The type of the message. For an MT message, the format is fin|apc.<msgtype>[.<variant>]. For example: fin.103, fin.103.REMIT or fin.202, fin.202.COV
          maxLength: 30
          type: string
        sender:
          description: |-
           It corresponds to the BIC12 of the sender. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For received messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        receiver:
          description: |-
           It corresponds to the BIC12 of the receiver. The format of the BIC12 is: <BIC8><Logical terminal><Branch code>.
           For sent messages, the Logical terminal value will always be X.
          maxLength: 12
          minLength: 12
          type: string
        interface_info:
          $ref: '#/components/schemas/FinMessageInterfaceInfoEmission'
        network_info:
          $ref: '#/components/schemas/FinMessageNetworkInfoEmission'
        payload:
          description: |-
           The business message contents. As this is a FIN message, this contains the MT block 4 (text) data.
          type: string
          format: byte
          maxLength: 14000
      description: FIN Message upload
    FinMessageSecurityInfoReception:
      title: FinMessageSecurityInfoReception
      type: object
      additionalProperties: true
      properties:
        rma_result:
          description: |-
           The result of the RMA check. Not present when message is not subject to RMA authorisation.
          type: string
          nullable: true
          enum:
          - Success
          - Bypassed
          - NoRecord
          - NotEnabled
          - InvalidPeriod
          - Unauthorised
        checksum_result:
          description: |-
           The result of the FIN checksum validation.
          type: string
          nullable: true
          enum:
          - Success
          - Failed
        checksum_value:
          description: |-
           The value of the FIN checksum.
          type: string
          maxLength: 12
        pac_result:
          description: |-
           The result of the PAC verification.
          type: string
          nullable: true
          enum:
          - Success
          - SuccessFuture
          - SuccessOld
          - Bypassed
          - NoKey
          - Failed
          - InvalidDigest
          - InvalidSignerDN
          - InvalidCertificatePolicyID
        pac2_signature_value:
          description: |-
           Signature of the PAC2 equivalent digest, used for authentication between the Central Institution and the Receiver of the message.
          type: string
          format: byte
        mac_result:
          description: |-
           The result of the MAC verification.
          type: string
          nullable: true
          enum:
          - Success
          - SuccessFuture
          - SuccessOld
          - Bypassed
          - NoKey
          - Failed
          - InvalidDigest
          - InvalidSignerDN
          - InvalidCertificatePolicyID
        mac_signature_value:
          description: |-
           Signature of the MAC equivalent digest (also includes the PAC1 equivalent digest if required).
          type: string
          format: byte
        transaction_data_security_result:
          type: string
          description: |- 
           For messages received from Transaction Manager, this field indicates the result of the transaction data security validation.
          nullable: true
          enum:
            - Success
            - Bypassed
            - InvalidDigest
            - InvalidSignerDN
            - InvalidCertificatePolicyID
      description: The security information elements for a FIN message received from Alliance Cloud.
    Nak:
      title: NAK
      type: object
      additionalProperties: false
      properties:
        reason:
          description: |-
           A textual description of the reason for the NAK.
          type: string
          maxLength: 255
      description: Distribution NAK
