      description: The interface information elements for a received FIN message.
    FinMessageNetworkInfoEmission:
      title: FinMessageNetworkInfoEmission
      type: object
      additionalProperties: false
      properties:
        network_priority:
          description: |-
           The Network priority
          type: string
          default: Normal
          nullable: true
          enum:
          - Normal
          - Urgent
          - System
        possible_duplicate:
          description: |-
           For messages originated from the BO: if set to true, the BO indicates that the message is a PDE (Possible Duplicate Emission)
          type: boolean
        delivery_monitoring:
          description: |-
           Indicates whether a non-delivery warning and/or a positive delivery notification is requested.
          type: string
          nullable: true
          enum:
          - None
          - NonDelivery
          - NonDeliveryAndDelivery
          - Delivery
        banking_priority:
          description: |-
           FIN User Header field 113: Banking Priority set by the creator of the message.
          maxLength: 4
          type: string
        fincopy_service:
          description: |-
           Service code of the fin copy service.
          maxLength: 3
          type: string
        fincopy_central_institution_destination:
          description: |-
           BIC8 of the central institution used for FIN Copy.
          maxLength: 8
          type: string
        validation_identifier:
          description: |-
           FIN User Header field 119: Contains the Validation Identifier and indicates whether FIN central system must perform a special validation.
          maxLength: 8
          type: string
        uetr:
          description: |-
           A unique end-to-end transaction reference. This reference must contain a Universally Unique IDentifier (UUID) compliant with version 4 of standard RFC4122.
           It is transported in field 121 of gpi messages.
          type: string
          format: uuid
        message_user_reference:
          description: |-
           The Message User Reference set by the BO for messages received by the BO or by the user for messages manually created or by the sender for received messages.
           For FIN, this corresponds to the MUR (field 108 of block 3).
          maxLength: 16
          type: string
        service_type_identifier:
          description: |-
           A numeric code contained in field 111 of a FIN gpi message that identifies the gpi service against which the gpi customer will be measured.
           For example, the service type identifier for the gpi customer credit transfer service is 001.
          maxLength: 3
          type: string
      description: The network information elements for a FIN message sent to Alliance Cloud.
    InterActMessagesBatchEmission:
