          description: |-
           The SWIFTNet service code.
          maxLength: 30
          type: string
        message_type:
          description: |-
           The type of the message. For an MX message, the format is: <bus. area>.<msg type>.<variant>.<version>. For example, ifds.001.001.01
          maxLength: 30
          type: string
        requestor:
          description: |-
           The distinguished name (DN) of the sender of the message.
          maxLength: 100
          type: string
        responder:
          description: |-
           The distinguished name (DN) of the receiver of the message.
          maxLength: 100
