          - MX
          - ANY_XML
        payload:
          description: |-
           The business message contents. As this is an InterAct message, this usually contains the Application Header (if present) and the Business Document.
           That business contents must be wrapped within an 'envelope' top-level XML element so that it forms a valid XML document.
           Example (before being Base64-encoded for API sending):
           ```
              <envelope:Envelope xmlns:envelope="urn:swift:xsd:envelope">
                  <AppHdr xmlns="urn:swift:xsd:$ahV10">
                      [Omitted for brevity]
                  </AppHdr>
                  <mx:Document xmlns:mx="urn:swift:xsd:acmt.004.001.06">
                      [Omitted for brevity]
