    InterActMessageReception:
      title: InterActMessageReception
      required:
      - direction
      - message_type
      - payload
      - requestor
      - responder
      - sender_reference
      - service_code
      - version
      type: object
      additionalProperties: true
      properties:
        sender_reference:
          description: |-
           For emission and STP: represents the reference from the back office.
           For reception or GUI: contains the Message Cloud Reference.
          maxLength: 70
          type: string
        service_code:
          description: |-
           The SWIFTNet service code.
          maxLength: 30
          type: string
        message_type:
          description: |-
           The type of the message. For an MX message, the format is: <bus. area>.<msg type>.<variant>.<version>. For example, ifds.001.001.01
          maxLength: 30
          type: string
        direction:
          description: |-
           Direction of the message. Possible values are:
            - Incoming: message received from the network
            - Outgoing: message sent to the network
          type: string
          nullable: true
          enum:
          - Incoming
          - Outgoing
        requestor:
          description: |-
           The distinguished name of the sender of the message.
          maxLength: 100
          type: string
        responder:
          description: |-
           The distinguished name of the receiver of the message.
          maxLength: 100
          type: string
        version:
          description: |-
            Identifies the version for this received message. Messages that are modified in Alliance Cloud have their version incremented. The initial version of a message is 0
          type: integer
        interface_info:
          $ref: '#/components/schemas/InterActMessageInterfaceInfoReception'
        network_info:
          $ref: '#/components/schemas/InterActMessageNetworkInfoReception'
        security_info:
          $ref: '#/components/schemas/InterActMessageSecurityInfoReception'
        format:
          description: |-
           The message format: 
           - For an MX message: MX
           - For any InterAct message in an XML format not included in a deployment package installed on Alliance Cloud: ANY_XML
          type: string
          enum:
          - MX
          - ANY_XML
        payload:
          description: |-
           The business message contents. As this is an InterAct message, this usually contains the Application Header (if present) and the Business Document.
           That business contents is wrapped within an 'envelope' top-level XML element so that it forms a valid XML document.
           Example (when Base64-decoded):
           ```
              <envelope:Envelope xmlns:envelope="urn:swift:xsd:envelope">
                  <AppHdr xmlns="urn:swift:xsd:$ahV10">
                      [Omitted for brevity]
                  </AppHdr>
                  <mx:Document xmlns:mx="urn:swift:xsd:acmt.004.001.06">
                      [Omitted for brevity]
                  </mx:Document>
              </envelope:Envelope>
           ```
          maxLength: 140000
          type: string
          format: byte
      description: InterAct message contents received from Alliance Cloud. Depending on the 'direction', the available fields will vary. 'Outgoing' direction is for a message sent from a back-office to SWIFT, via Alliance Cloud. 'Incoming' is for a message received from SWIFT, via Alliance Cloud.
    InterActMessageInterfaceInfoEmission:
      title: InterActMessageInterfaceInfoEmission
      type: object
      additionalProperties: false
      properties:
        product_info:
          $ref: '#/components/schemas/ProductInfoEmission'
      description: The interface information elements for a sent InterAct message.
    InterActMessageInterfaceInfoReception:
      title: InterActMessageInterfaceInfoReception
      type: object
      additionalProperties: true
      properties:
        product_info:
          $ref: '#/components/schemas/ProductInfoReception'
      description: The interface information elements for a received InterAct message.
    InterActMessageNetworkInfoReception:
      title: InterActMessageNetworkInfoReception
      type: object
      additionalProperties: true
      properties:
        user_reference:
          description: |-
           The Message User Reference set by the BO for messages received by the BO or by the user for messages manually created or by the sender for received messages.
          maxLength: 30
          type: string
        network_priority:
          description: |-
           The Network priority.
          type: string
          default: Normal
          nullable: true
          enum:
          - Normal
          - Urgent
        possible_duplicate:
          description: |-
           For messages originated from the BO: if set to true, the BO indicated that the message is a PDE (Possible Duplicate Emission).
           For messages sent to the BO: if set to true, Alliance Cloud indicates that the message is a PDE. The reason can either be duplicate detected by Cloud or set by the sender, or by the Network, or by the BO in case it is related to the copy of a message.
          type: boolean
        duplicate_history:
          $ref: '#/components/schemas/DuplicateHistorySwiftNet'
        delivery_notification_requested:
          description: |-
           Indicates whether a non-delivery warning and/or a positive delivery notification is requested.
          type: boolean
        non_delivery_warning_requested:
          description: |-
           Indicates whether non-delivery warning time or non-delivery warning delay is set up.
          type: boolean
        non_delivery_warning_time:
          description: |-
           Time and date in UTC after which the SWIFT central system has to generate an overdue warning if the message/file remains undelivered.
           If present, non_delivery_warning_delay cannot be specified.
          type: string
          format: date-time
        non_delivery_warning_delay:
          description: |-
           Number of minutes after which SWIFT central system has to generate an overdue warning if the message/file remains undelivered.
           If present, non_delivery_warning_time cannot be specified.
          maximum: 1440
          minimum: 5
          type: integer
          format: int32
        session_number:
          description: |-
           The network session number.
          type: integer
        sequence_number:
          description: |-
           The network sequence number.
          type: integer
        swift_reference:
          description: |-
           The reference generated by the SWIFT central system.
          maxLength: 50
          type: string
        reference:
          description: |-
           The reference generated by the correspondent application (for messages received).
          maxLength: 40
          type: string
        validation_descriptor:
          description: |-
           MVal processing result.
          type: string
          format: byte
        response_responder_dn:
          description: |-
           The responder DN of the business response. Real-time messages only.
          maxLength: 100
          type: string
        response_swift_reference:
          description: |-
           The reference generated by the SWIFT central system for the response.
          maxLength: 50
          type: string
        response_reference:
          description: |-
           The reference generated by the responding application.
          maxLength: 40
          type: string
        response_possible_duplicate:
          description: |-
           Indicates whether the response is a possible duplicate.
          type: boolean
        response_validation_descriptor:
          description: |-
           MVal processing result of the response.
          type: string
          format: byte
        payload_attributes:
          description: |-
           Attributes associated to the payload for this SWIFTNet request.
          type: array
          items:
            $ref: '#/components/schemas/PayloadAttribute'
        response_payload_attributes:
          description: |-
           Attributes associated to the response payload for this SWIFTNet request.
          type: array
          items:
            $ref: '#/components/schemas/PayloadAttribute'
        copy_requested:
          description: |-
           True when the SWIFTNet copy feature is optional for that service and a copy must be made. 
           When absent, a copy is only made when the copy feature is defined as mandatory for the service.
           If the copy service is defined as mandatory, then this value cannot be false.
          type: boolean
        copy_destinations:
          description: |-
           The list of third party recipients to which the message or file must be copied in case of dynamic T- or Y-Copy.
          maxItems: 10
          type: array
          items:
            description: |-
             A single third party recipient DN.
            maxLength: 100
            type: string
        copy_authorisation_notification_requested:
          description: |-
           Request a positive Authorisation Notification for Y-Copy service.
          type: boolean
        copy_info:
          description: |-
           Provides SWIFTNet copy-processing related information.
          type: string
          format: byte
        copy_original_snf_reference:
          description: |-
           Indicates the original SnF reference of the message in a delivery notification related to SWIFTNet copy.
          maxLength: 50
          type: string
        recipients:
          description: |-
            The list of recipients to whom the message must be distributed.
          maxItems: 1000
          type: array
