        message_cloud_reference:
          description: |-
            The unique Alliance Cloud assigned identifier for this sent message. Will only be present for a successful result.
          type: string
          format: uuid
        error_message:
          description: |-
            An error message describing the cause of the unsuccessful result for this sent message. Will only be present for an unsuccessful result.
